import { Paper, TableBody, TableCell, TableContainer, TableRow } from '@material-ui/core';
import axios from 'axios';
import React,{useEffect, useState} from 'react';
import base_url from '../../api/bootapi';


const List=(props)=>{
    // const [workAmt, setWorkAmt]=useState("");
    // const [workDesc, setWorkDesc]=useState("");
    // const [city, setCity]=useState("");
    // const [cat, setCat]=useState("");

    const [data, setData]=useState([]);

    useEffect(()=>{
        getDataFromServer();
    },[]);

    const getDataFromServer=()=>{
        axios.get(`${base_url}/user/workDetails/`).then(
            (response)=>{
                console.log(response.data);
                // setWorkAmt(response.data.workAmount);
                // setWorkDesc(response.data.description);
                // setCity(response.data.location);
                // setCat(response.data.category);
                setData(response.data);
            },(error)=>{
                console.log(error);
            }
        )
    };

    return data.length>0
    ?(
        <table>
            <thead>
                <tr>
                    {this.renderTableHeader()}
                </tr>
            </thead>
            <tbody>
                {this.renderTableRows()}
            </tbody>
        </table>
        // <div>
        //     {data.map((item)=>(
                
        //     ))}
        // </div>
    ):(
        <div>
            No Work Available
        </div>
    )
}
export default List;
